import React from "react";


class SearchBar extends React.Component {
    render() {
        return (
            <div className="ui segment serch-bar">
                <form className="ui form">
                    <div className="ui field">
                        <label>Search</label>
                        <input type="text" ></input>
                    </div>
                </form>
            </div>
        )
    }
}

export default SearchBar;
